column8:
「アミノバイタル」はカラダを良い状態に保つ分岐鎖アミノ酸（BCAA）と、健康的な生活に大切なグルタミン・アルギニンをベストバランスで組み合わせた、顆粒タイプのアミノ酸健康習慣サプリメント。 ●「アミノバイタル」プロはアミノ酸を約3600mg、ビタミン8種類配合。 ●限界に挑戦するアスリートや、週末に思い切りスポーツを楽しみたい方に最適です。 ●スポーツする日に数回お飲みいただくことで、スポーツの後半、スポーツの翌日が違います。<BR>
【標準栄養成分製品(4.5g)あたり】<BR>
エネルギー／18kcal
たんぱく質／3.6g
脂質／0.1g
炭水化物／0.5g
ナトリウム／0.83mg
ビタミンA／148μg
ビタミンB1／0.9mg
ビタミンB2／0.7mg
ビタミンB6／0.9mg
ナイアシン／3.8mg
パントテン酸／1.5mg
ビタミンD／1.8μg
ビタミンE／1.9mg
<BR>
【アミノ酸3.6g】
ロイシン／0.54g
イソロイシン／0.43g
バリン／0.36g
グルタミン／0.65g
アルギニン／0.61g
